import React, { useEffect, useState } from "react";
import { useNavigate, useLocation } from "react-router-dom";
import axios from "axios";
import "../styles/UploadImagesPage.css";

const UploadImagesPage = () => {
    const [customerId, setCustomerId] = useState(null);
    const [frontImage, setFrontImage] = useState(null);
    const [backImage, setBackImage] = useState(null);
    const [notification, setNotification] = useState("");
    const [isUploadSuccessful, setIsUploadSuccessful] = useState(false);

    const navigate = useNavigate();
    const location = useLocation();

    useEffect(() => {
        const searchParams = new URLSearchParams(location.search);
        const id = searchParams.get("customerId");
        if (!id) {
            setNotification("Customer ID is missing. Please return to the manual scan page.");
        } else {
            setCustomerId(id);
        }
    }, [location.search]);

    const handleSubmit = async (e) => {
        e.preventDefault();

        if (!customerId || !frontImage || !backImage) {
            setNotification("Please upload both images.");
            setIsUploadSuccessful(false);
            return;
        }

        const formData = new FormData();
        formData.append("customer_id", customerId); // Use the customer ID here
        formData.append("front_image", frontImage);
        formData.append("back_image", backImage);

        try {
            const response = await axios.post(
                `http://localhost:8000/upload-customer-images`,
                formData,
                { headers: { "Content-Type": "multipart/form-data" } }
            );

            if (response.status === 200) {
                setNotification("Images uploaded successfully!");
                setIsUploadSuccessful(true);
            } else {
                setNotification("Failed to upload images. Please try again.");
                setIsUploadSuccessful(false);
            }
        } catch (error) {
            console.error("Error uploading images:", error.response?.data || error);
            setNotification("An unexpected error occurred while uploading images.");
            setIsUploadSuccessful(false);
        }
    };

    return (
        <div className="upload-images-page">
            <h1>Upload Images</h1>
            <form onSubmit={handleSubmit} className="upload-form">
                {customerId && (
                    <p>
                        <strong>Customer ID:</strong> {customerId}
                    </p>
                )}
                <div className="form-group">
                    <label htmlFor="front-image">Front Image:</label>
                    <input
                        type="file"
                        id="front-image"
                        accept="image/*"
                        onChange={(e) => setFrontImage(e.target.files[0])}
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="back-image">Back Image:</label>
                    <input
                        type="file"
                        id="back-image"
                        accept="image/*"
                        onChange={(e) => setBackImage(e.target.files[0])}
                        required
                    />
                </div>
                <button type="submit" className="button upload-button">
                    Upload Images
                </button>
            </form>
            {notification && <div className="notification">{notification}</div>}
        </div>
    );
};

export default UploadImagesPage;
